import React from 'react';
import logo from './logo.svg';
import './App.css';
import './home.css';

function App() {
  return (
    <div className="App">
      <header>
          <div id="logo"><img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/148866/cd-logo.svg" alt="Homepage"></img></div>

          <div id="cd-hamburger-menu"><a className="cd-img-replace" href="#0">Menu</a></div>
          <div id="cd-cart-trigger"><a className="cd-img-replace" href="#0">Cart</a></div>
      </header>

        <nav id="main-nav">
          <ul>
            <li><a href="#0">Home</a></li>
            <li><a href="#0">About</a></li>
            <li><a className="current" href="#0">Services</a></li>
            <li><a href="#0">Gallery</a></li>
            <li><a href="#0">Contact</a></li>
          </ul>
        </nav>

    </div>
  );
}

export default App;
